            teamId: "",
            tid: "",
        }

    }

    componentDidUpdate(prevProps){
        if (this.props.teamId !== prevProps.teamId) {
            this.setState({
                teamId: this.props.username[0]
            })
          }

          if (this.props.tid !== prevProps.tid) {
